    false,nt"url": null,nt"notes": "This blueprint describes how the National
    Wildlife Refuge System will initially implement a nationally coordinated program
    to support inventorying and monitoring (I&M program) at refuge, landscape, regional,
    and national scales. The I&M program is designed to address the Refuge Systemu2019s
    critical information needs and to help plan and evaluate the effectiveness of conservation
    strategies implemented by the U.S. Fish and Wildlife Service (Service) and conservation
    partners in the face of accelerating climate change and growing threats from other
    environmental stressors. This Operational Blueprint establishes the initial structure
    of the I&M program and identifies priority tasks to be initiated in Phase 1 (Fiscal
    Years 2010 and 2011).",nt"license_title": "License Not Specified",nt"extras":
